```bash
npm install react-beautiful-dnd
```

### Step 3: Create Basic Structure

Create a new file called `KanbanBoard.js`. This will be your main component where you define the structure of your Kanban board.

```jsx
import React from 'react';
import { DragDropContext, Droppable, Draggable } from 'react-beautiful-dnd';

const KanbanBoard = () => {
    const [tasks, setTasks] = React.useState([
        { id: '1', content: 'Task 1' },
        { id: '2', content: 'Task 2' },
        { id: '3', content: 'Task 3' }
    ]);

    const onDragEnd = (result) => {
        if (!result.destination) return;

        const items = Array.from(tasks);
        const [reorderedItem] = items.splice(result.source.index, 1);
        items.splice(result.destination.index, 0, reorderedItem);

        setTasks(items);
    };

    return (
        <div style={{ display: 'flex', flexWrap: 'wrap', gap: '1rem' }}>
            <DragDropContext onDragEnd={onDragEnd}>
                <Droppable droppableId="columns">
                    {(provided) => (
                        <div {...provided.droppableProps} ref={provided.innerRef}>
                            {tasks.map((task, index) => (
                                <Draggable key={task.id} draggableId={task.id} index={index}>
                                    {(provided) => (
                                        <div
                                            ref={provided.innerRef}
                                            {...provided.draggableProps}
                                            {...provided.dragHandleProps}
                                        >
                                            {task.content}
                                        </div>
                                    )}
                                </Draggable>
                            ))}
                            {provided.placeholder}
                        </div>
                    )}
                </Droppable>
            </DragDropContext>
        </div>
    );
};

export default KanbanBoard;
```

### Step 4: Style Your Board

Add some CSS to style your Kanban board. You can do this in a separate CSS file or within a `<style>` tag in your JSX file.

```css
.Draggable {
    background-color: #f4f4f4;
    padding: 1rem;
    border-radius: 5px;
    margin-bottom: 1rem;
    cursor: grab;
}

.Draggable:hover {
    background-color: #e4e4e4;
}
```

### Step 5: Render the Board

Finally, render your `KanbanBoard` component in your `App.js`.

```jsx
import React from 'react';
import KanbanBoard from './KanbanBoard';

function App() {
  return (
    <div className="App">
      <h1>Kanban Board</h1>
      <KanbanBoard />
    </div>
  );
}

export default App;
```

### Step 6: Run Your Application

Start your React application to see your Kanban board in action.

```bash
npm start
```

This is a very basic implementation. In a real-world application, you would likely want to add more features such as adding tasks dynamically, categorizing tasks into different columns (like "To Do", "In Progress", "Done"), and persisting task data to a database or local storage.

