### Prototype

In Swift, a **prototype** is like a blueprint or a template for creating objects (instances). It defines the properties (like variables) and methods (functions) that an object will have. When you create a new object from this blueprint, it follows all the rules defined in the prototype.

Imagine you're building a model airplane. The prototype would be like the design or pattern you follow to build your airplane. Every airplane you build from this prototype will look similar but can have its own unique details.

