Below is an example of a simple React component that uses `react-query` to fetch data from an API. This example assumes you have a backend service that provides some data at a specific endpoint.

### Example Component

```jsx
import React from 'react';
import { useQuery } from '@tanstack/react-query';

// Function to fetch data from the API
const fetchData = async () => {
  const response = await fetch('https://api.example.com/data');
  if (!response.ok) {
    throw new Error('Network response was not ok');
  }
  return response.json();
};

const DataFetchingComponent = () => {
  // Use the useQuery hook to fetch data
  const { isLoading, isError, error, data } = useQuery(['data'], fetchData);

  if (isLoading) return <div>Loading...</div>;
  if (isError) return <div>Error: {(error as Error).message}</div>;

  return (
    <div>
      <h1>Data from API</h1>
      <ul>
        {data.map((item) => (
          <li key={item.id}>{item.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default DataFetchingComponent;
```

### Explanation

- **useQuery**: This hook is used to fetch and manage data from the API. It takes two arguments:
