  - The second argument is a function that makes the actual API call (`fetchData` in this case).

- **isLoading**: This variable will be `true` while the data is being fetched.

- **isError**: If there's an error during the fetch operation, this variable will be `true`.

- **error**: Contains the error object if there was an error.

- **data**: Once the data is successfully fetched, it will be stored in this variable.

