Here's a step-by-step guide to setting up WebSocket communication from an Android app to a Spring Boot backend using STOMP and SockJS:

### Step 1: Add Dependencies

First, ensure you have the necessary dependencies in your Android Studio project. Add these to your `build.gradle` file under the app module:

```gradle
dependencies {
    implementation 'org.java-websocket:Java-WebSocket:1.5.2' // Optional if not using SockJS
    implementation 'org.springframework:spring-websocket:5.3.10' // Use version compatible with your Spring Boot version
    implementation 'org.webjars:sockjs-client:1.0.2'
    implementation 'org.webjars:stomp-websocket:2.3.3'
}
```

Note: The versions provided above (`5.3.10`, `1.0.2`, `2.3.3`) should be updated to match the latest stable versions of their respective libraries.

### Step 2: Configure WebSockets in Android

Create a class to handle WebSocket connections. Here’s an example:

```java
import org.java_websocket.client.WebSocketClient;
import org.java_websocket.handshake.ServerHandshake;
import org.springframework.messaging.simp.stomp.StompSession;
import org.springframework.messaging.simp.stomp.StompSessionHandlerAdapter;

import javax.net.ssl.SSLSocketFactory;
import javax.net.ssl.X509TrustManager;
import java.net.URI;
import java.security.cert.X509Certificate;

public class WebSocketConnection {

    private StompSession session;

    public void connect() {
        try {
            URI uri = new URI("ws://yourserveraddress:port/socket");
            WebSocketContainer container = ContainerProvider.getWebSocketContainer();
            container.connectToServer(new MyStompSessionHandler(), ClientEndpointConfig.Builder.create().build(), uri);
        } catch (Exception e) {
            e.printStackTrace();
        }
    }

    private class MyStompSessionHandler extends StompSessionHandlerAdapter {
        @Override
        public void afterConnected(StompSession session, StompHeaders connectedHeaders) {
            this.session = session;
            session.subscribe("/topic/messages", this);
        }

        @Override
        public void handleFrame(StompHeaders headers, Object payload) {
            System.out.println(headers);
            System.out.println(payload);
        }
    }
}
```

