```java
import org.java_websocket.client.WebSocketClient;
import org.java_websocket.handshake.ServerHandshake;
import org.springframework.web.socket.client.standard.StandardWebSocketClient;
import org.springframework.web.socket.config.annotation.EnableWebSocketMessageBroker;
import org.springframework.web.socket.messaging.WebSocketStompClient;
import org.springframework.web.socket.sockjs.client.SockJsTransportCodec;
import org.springframework.web.socket.sockjs.client.Transport;
import org.springframework.web.socket.sockjs.client.WebSocketTransport;

import java.net.URI;
import java.util.concurrent.CountDownLatch;

public class WebSocketConnection {

    public void connect() {
        CountDownLatch latch = new CountDownLatch(1);

        WebSocketTransport transport = new WebSocketTransport(new StandardWebSocketClient());
        SockJsTransportCodec codec = new SockJsTransportCodec();

        Transport chosenTransport = new WebSocketTransport(new StandardWebSocketClient());

        WebSocketStompClient stompClient = new WebSocketStompClient(chosenTransport);
        stompClient.setMessageConverter(new MappingJackson2MessageConverter());

        stompClient.connect(URI.create("ws://yourserveraddress:port/socket"), new MyStompSessionHandler(latch));
    }

    private class MyStompSessionHandler extends StompSessionHandlerAdapter {
        private final CountDownLatch latch;

        public MyStompSessionHandler(CountDownLatch latch) {
            this.latch = latch;
        }

        @Override
        public void afterConnected(StompSession session, StompHeaders connectedHeaders) {
            session.subscribe("/topic/messages", this);
            latch.countDown();
        }

        @Override
        public void handleFrame(StompHeaders headers, Object payload) {
            System.out.println(headers);
            System.out.println(payload);
        }
    }
}
