    implementation 'org.java-websocket:Java-WebSocket:1.5.2'
    implementation 'org.springframework:spring-websocket:5.3.10' // or any version compatible with your Spring Boot version
}
```

### Step 2: Configure SockJS Client

Create a class to handle the WebSocket connection and message handling. This example uses `SockJsClient` from `spring-websocket` which supports STOMP over WebSocket and other transports provided by SockJS.

```java
import org.java_websocket.client.WebSocketClient;
import org.java_websocket.handshake.ServerHandshake;
import org.springframework.messaging.simp.stomp.StompFrameHandler;
import org.springframework.messaging.simp.stomp.StompHeaders;
import org.springframework.messaging.simp.stomp.StompSession;
import org.springframework.messaging.simp.stomp.StompSessionHandlerAdapter;

import java.net.URI;
import java.util.concurrent.CompletableFuture;

public class MyWebSocketClient {

    private StompSession stompSession;

    public void connect() {
        URI uri = URI.create("ws://your-backend-url/websocket");
        CompletableFuture<StompSession> future = Stomp.over(new SockJsClient(Arrays.asList(
                new WebSocketTransport(new StandardWebSocketClient())
        )).connect(uri, new StompSessionHandlerAdapter() {
            @Override
            public void afterConnected(StompSession session, StompHeaders connectedHeaders) {
                stompSession = session;
                System.out.println("Connected to WebSocket Server");
                subscribeToTopic();
            }
        }));
        stompSession = future.join();
    }

    private void subscribeToTopic() {
        stompSession.subscribe("/topic/your_topic", new StompFrameHandler() {
            @Override
            public Type getPayloadType(StompHeaders headers) {
                return String.class;
            }

            @Override
            public void handleFrame(StompHeaders headers, Object payload) {
                System.out.println("Received message: " + (String) payload);
            }
        });
    }
}
```

### Step 3: Use the WebSocket Client

Now you can instantiate and use your `MyWebSocketClient` in your Android activity or wherever appropriate in your application.

```java
public class MainActivity extends AppCompatActivity {

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_main);

        MyWebSocketClient webSocketClient = new MyWebSocketClient();
        webSocketClient.connect();

        // Other initialization code...
    }
}
```

