To integrate the Wistia Uploader into an Angular 14 application, you will need to follow several steps. Wistia does not provide a direct Angular package for its uploader, but you can embed it using JavaScript and interact with it via Angular's services or components.

Here’s a step-by-step guide:

### Step 1: Create a Service for Wistia Interaction

First, create an Angular service that will handle interactions with the Wistia uploader.

1. **Generate a Service**: Use Angular CLI to generate a service.
   ```bash
   ng generate service wistia-uploader
   ```

2. **Implement the Service**: In `wistia-uploader.service.ts`, import necessary modules and define methods to initialize and control the Wistia uploader.
   ```typescript
   import { Injectable } from '@angular/core';
   declare var Wistia: any;

   @Injectable({
     providedIn: 'root'
   })
   export class WistiaUploaderService {
     private wistiaPlayer: any;

     constructor() {}

     initUploader(videoId: string) {
       if (!this.wistiaPlayer) {
         this.wistiaPlayer = Wistia.api(videos => {
           this.wistiaPlayer = videos[videoId];
           this.wistiaPlayer.on('ready', () => {
             console.log('Wistia player is ready');
           });
           this.wistiaPlayer.on('upload:start', () => {
             console.log('Upload started');
           });
           // Add more event listeners as needed
         });
       }
     }

     startUpload(file: File) {
       if (this.wistiaPlayer) {
         this.wistiaPlayer.uploadFile(file);
       }
     }
   }
   ```

### Step 2: Include Wistia Script in Your Application

Include the Wistia script in your Angular application. You can do this by adding a `<script>` tag in your `index.html` file or dynamically loading it in your component.

#### Option A: Adding Script Tag in `index.html`
```html
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="utf-8">
  <title>Your App Title</title>
  <base href="/">
  <!-- Other head elements -->
  <script src="https://fast.wistia.com/static/concat/wistia-production-minified.js" async></script>
</head>
<body>
  <app-root></app-root>
</body>
</html>
```

#### Option B: Dynamically Loading Script in Component
If you prefer not to modify `index.html`, you can load the script dynamically in a component's `ngAfterViewInit` lifecycle hook:
```typescript
import { AfterViewInit, Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-your-component',
  templateUrl: './your-component.component.html',
  styleUrls: ['./your-component.component.css']
})
export class YourComponent implements OnInit, AfterViewInit {
  constructor(private wistiaUploaderService: WistiaUploaderService) {}

  ngOnInit(): void {}

  ngAfterViewInit(): void {
    const script = document.createElement('script');
    script.src = 'https://fast.wistia.com/static/concat/wistia-production-minified.js';
    script.async = true;
    document.body.appendChild(script);

    script.onload = () => {
      this.wistiaUploaderService.initUploader('your-video-id');
    };
  }
}
```

### Step 3: Use the Service in Your Components

Now, you can use the `WistiaUploaderService` in your Angular components to upload files.

```typescript
import { Component, OnInit, ViewChild, ElementRef } from '@angular/core';
import { WistiaUploaderService } from '../services/wistia-uploader.service';

@Component({
  selector: 'app-your-component',
  template: `
    <input #fileInput type="file" (change)="onFileSelected($event)">
  `,
  styles: []
})
export class YourComponent implements OnInit {
  @ViewChild('fileInput') fileInput!: ElementRef;

  constructor(private wistiaUploaderService: WistiaUploaderService) {}

  onFileSelected(event: Event) {
    const target = event.target as HTMLInputElement;
    if (target.files && target.files.length > 0) {
      const file = target.files[0];
      this.wistiaUploaderService.startUpload(file);
    }
  }

  ngOnInit(): void {}
}
```

