```javascript
import axios from 'axios';

export default async function handler(req, res) {
    const { name, email, website, comment, postId } = req.body;

    if (req.method === 'POST') {
        try {
            const response = await axios.post(
                `${process.env.WORDPRESS_API_URL}/wp-json/wp/v2/comments`, 
                {
                    post: postId,
                    author_name: name,
                    author_email: email,
                    author_url: website,
                    content: comment,
                }, 
                {
                    headers: {
