Creating a browser extension that automatically links Tezos wallet or contract addresses to the `tzkt.io` website involves several steps. Below is an outline of how you can achieve this using JavaScript and web technologies. This example assumes you're familiar with HTML, CSS, and JavaScript.

### Step 1: Set Up the Browser Extension

First, create a directory for your extension and set up the necessary files:

- `manifest.json`: The manifest file defines the metadata and permissions of the extension.
- `background.js`: A background script to handle certain tasks.
- `content.js`: A content script to interact with the webpage.
- `popup.html`: An optional popup interface for the extension.
- `popup.js`: An optional script for the popup interface.
- `icon.png`: An icon for the extension.

### Step 2: Define the Manifest File

Create a `manifest.json` file in your project directory:

```json
{
  "manifest_version": 3,
  "name": "Tezos Address Linker",
  "version": "1.0",
  "description": "Links Tezos wallet or contract addresses to tzkt.io",
  "permissions": [
    "activeTab"
  ],
  "content_scripts": [
    {
      "matches": ["<all_urls>"],
      "js": ["content.js"]
    }
  ],
  "browser_action": {
    "default_popup": "popup.html",
    "default_icon": {
      "16": "icon.png",
      "48": "icon.png",
      "128": "icon.png"
    }
  },
  "icons": {
    "16": "icon.png",
    "48": "icon.png",
    "128": "icon.png"
  }
}
```

### Step 3: Create the Content Script

Create a `content.js` file to process and link addresses on webpages:

```javascript
function linkAddresses() {
  const regex = /tz[1-3][1-9A-HJ-NP-Za-km-z]{33}/g; // Regular expression to match Tezos addresses
  const elements = document.body.innerText.match(regex);

  if (elements) {
    elements.forEach(address => {
      const anchor = document.createElement('a');
      anchor.href = `https://tzkt.io/${address}`;
      anchor.textContent = address;
      anchor.target = '_blank';

      // Find and replace the text in the original document
      const parentElement = document.evaluate(`//*[contains(text(), '${address}')][not(ancestor::a)]`, document, null, XPathResult.FIRST_ORDERED_NODE_TYPE).singleNodeValue;
      if (parentElement) {
        const range = document.createRange();
        range.selectNodeContents(parentElement);
        const selection = window.getSelection();
        selection.removeAllRanges();
        selection.addRange(range);

        const span = document.createElement('span');
        span.innerHTML = selection.toString().replace(new RegExp(address, 'g'), `<a href="https://tzkt.io/${address}" target="_blank">${address}</a>`);
        parentElement.innerHTML = span.innerHTML;
      }
    });
  }
}

// Run the function when the DOM content is loaded
document.addEventListener('DOMContentLoaded', linkAddresses);
